    "2016-11-25T21:06:26.411009",nt"name": "national-assessment-of-educational-progress-2009-high-school-transcript-study",nt"isopen":
    true,nt"url": null,nt"notes": "The National Assessment of Educational Progress,
    2009 High School Transcript Study (HSTS 2009), is a study that is part of the National
    Assessment of Educational Progress (NAEP) program; program data available since
    1990 at <http://nces.ed.gov/nationsreportcard/naepdata/>. HSTS 2009 (http://nces.ed.gov/nationsreportcard/hsts/)
    is a cross-sectional survey that periodically surveys the curricula being followed
    in our nation's high schools and the coursetaking patterns of high school students
    through a collection of transcripts. The study was conducted using survey of school
    administrative personnel and collection of students' transcripts. For public schools,
    the HSTS sample was a subsample of the NAEP 2009 twelfth-grade public school sample
    for the operational mathematics and science assessments. For private schools, the
    HSTS sample was the NAEP 2009 twelfth-grade private school sample for the operational
    mathematics and science assessments. The studyufffds weighted response rate was
    83 percent. HSTS 2009 also offers information on the relationship of student coursetaking
    patterns to achievement at grade 12 as measured by NAEP. Key statistics produced
    from HSTS 2009 are information about the types of courses that graduates take, how
    many credits they earn, their grade point averages, and the relationship between
    coursetaking patterns and achievement, as measured by NAEP.",nt"license_title":
